You may set the following properties to further configure the call. Please note that  -p  is followed by one 
or more key-value-pairs, and is called like this  -p k1=v1 k2=v2  even though the listing below repeats the -p  for completeness.   -p update-mask=string   Required. Specifies the path, relative to  Model , of the field to update.  For example, to change the description of a model to  foo  and set its
default version to  version_1 , the  update_mask  parameter would be
specified as  description ,  default_version.name , and the  PATCH 
request body would specify the new value, as follows:
    {
       description :  foo ,
       defaultVersion : {
         name : version_1 
      }
    }
In this example, the model is blindly overwritten since no etag is given.  To adopt etag mechanism, include  etag  field in the mask, and include the etag  value in your model resource.  Currently the supported update masks are  description , default_version.name ,  labels , and  etag .
